/*!

=========================================================
* Argon Dashboard React - v1.2.2
=========================================================

* Product Page: https://www.creative-tim.com/product/argon-dashboard-react
* Copyright 2022 Creative Tim (https://www.creative-tim.com)
* Licensed under MIT (https://github.com/creativetimofficial/argon-dashboard-react/blob/master/LICENSE.md)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/

// reactstrap components
import React, { useState } from "react";
import axios from "axios";
import { checkPasswordStrength } from "views/functions/register.js";
import {
  Alert,
  Button,
  Card,
  CardHeader,
  CardBody,
  FormGroup,
  Form,
  Input,
  InputGroupAddon,
  InputGroupText,
  InputGroup,
  Row,
  Col,
  Tooltip,
} from "reactstrap";

const Register = () => {
  const [user, setUser] = useState("");
  const [password, setPassword] = useState("");
  const [passwordCheck, setPasswordCheck] = useState("");
  const [passwordError, setPasswordError] = useState(false);
  const [blankError, setBlankError] = useState(false);

  const handleSubmit = async (event) => {
    event.preventDefault();
    if (password !== passwordCheck) {
      setPasswordError(true);
    } else {
      setPasswordError(false);
    }
    if (user == "") {
      setBlankError(true);
    } else {
      setBlankError(false);
    }

    try {
      const response = await axios.post(
        "http://10.0.5.123:3000/auth/register",
        {
          username: user,
          password: password,
          passwordCheck: passwordCheck,
        }
      );
      console.log(response.data);
    } catch (error) {
      console.error(error);
    }
  };
  const passwordStrength = checkPasswordStrength(password);

  const handlePasswordChange = (e) => {
    setPassword(e.target.value);
    checkPasswordStrength(e.target.value);
  };
  return (
    <>
      <Col lg="6" md="8">
        <Card className="bg-secondary shadow border-0">
          <CardHeader className="bg-transparent">
            <h1 className="text-center mt-2 mb-3">Sign up</h1>
          </CardHeader>
          <CardBody className="px-lg-5 py-lg-5">
            <Form onSubmit={handleSubmit}>
              <FormGroup className="mb-3">
                <InputGroup className="input-group-alternative">
                  <InputGroupAddon addonType="prepend">
                    <InputGroupText>
                      <i className="ni ni-single-02" />
                    </InputGroupText>
                  </InputGroupAddon>
                  <Input
                    id="user"
                    placeholder="User"
                    type="text"
                    autoComplete="new-name"
                    value={user}
                    onChange={(e) => setUser(e.target.value)}
                  />
                </InputGroup>
              </FormGroup>

              <FormGroup className="mb-0">
                <InputGroup className="input-group-alternative">
                  <InputGroupAddon addonType="prepend">
                    <InputGroupText>
                      <i className="ni ni-lock-circle-open" />
                    </InputGroupText>
                  </InputGroupAddon>
                  <Input
                    placeholder="Password"
                    type="password"
                    autoComplete="new-password"
                    value={password}
                    onChange={handlePasswordChange}
                  />
                </InputGroup>
              </FormGroup>
              <div className="text-muted font-italic mb-3">
                <small>
                  password strength:{" "}
                  <span
                    className={`text-${passwordStrength.color} font-weight-700`}
                  >
                    {passwordStrength.text}
                  </span>
                </small>
              </div>
              <FormGroup>
                <InputGroup className="input-group-alternative">
                  <InputGroupAddon addonType="prepend">
                    <InputGroupText>
                      <i className="ni ni-lock-circle-open" />
                    </InputGroupText>
                  </InputGroupAddon>
                  <Input
                    placeholder="Password Check"
                    type="password"
                    autoComplete="new-password"
                    value={passwordCheck}
                    onChange={(e) => setPasswordCheck(e.target.value)}
                  />
                </InputGroup>
              </FormGroup>
              {passwordError && (
                <Alert color="danger">Password is not correct!</Alert>
              )}

              <div className="text-center">
                <Button className="mt-4" color="primary" type="submit">
                  Create account
                </Button>
              </div>
            </Form>
          </CardBody>
        </Card>
      </Col>
    </>
  );
};

export default Register;
